import { Image, View, TouchableOpacity} from 'react-native';
import { Styles } from "./Styles";

export function FormEnd(props){
    return(
        <View style = {Styles.formEnd}>
            <TouchableOpacity onPress={() => { if (props.onPress) props.onPress();}}>
                {(props.home)?
                 <Image source = { require('../../assets/icons/HomeB.png')} style={{ width: 24, height: 24 }} /> :
                 <Image source = { require('../../assets/icons/home.png')} style={{ width: 24, height: 24 }} />         
                }                    
            </TouchableOpacity>

            <TouchableOpacity onPress={() => { if (props.onPress) props.onPress();}}>
                {(props.dados)?
                    <Image source = { require('../../assets/icons/dadosB.png')} style={{ width: 24, height: 24 }} /> :
                    <Image source = { require('../../assets/icons/dados.png')} style={{ width: 24, height: 24 }} /> 
                }                  
            </TouchableOpacity>

            <TouchableOpacity onPress={() => { if (props.onPress) props.onPress();}}>
                {(props.config)?
                    <Image source = { require('../../assets/icons/ConfB.png')} style={{ width: 24, height: 24 }} />:
                    <Image source = { require('../../assets/icons/Conf.png')} style={{ width: 24, height: 24 }} />
                }   
            </TouchableOpacity>
        </View>
    );
}
